__data__.text:
{% docs address %}

Address unique to an individual wallet, validator, or token. 

{% enddocs %}

{% docs amount %}

The amount that was used in the transaction message. 

{% enddocs %}

{% docs amount_sent %}

The amount that the user sent in a transfer. 

{% enddocs %}

{% docs auth_info %}

The top level auth information for the transaction

{% enddocs %}

{% docs block_id %}

The block height the block was recorded at. 

{% enddocs %}

{% docs block_timestamp %}

The date and time at which the block began.

{% enddocs %}

{% docs blockchain %}

In this table, always Osmosis. Used to join to cross-chain tables. This column will deprecate in all tables except core.fact_blocks soon. Please modify your queries to join to the blocks table to use this field. 

{% enddocs %}

{% docs chain_id %}

The name and version of the blockchain. This column will deprecate in all tables except core.fact_blocks soon. Please modify your queries to join to the blocks table to use this field. 

{% enddocs %}

{% docs codespace %}

Namespace for the code. 

{% enddocs %}

{% docs completion_time %}

The time at which the undelegate or redelegate staking action is completed.

{% enddocs %}

{% docs creator %}

Name of the label creator - for now, this will always be "Flipside." 

{% enddocs %}

{% docs currency %}

The currency that was used in the transaction message. 

{% enddocs %}

{% docs decimal %}

Divide the amount by POW(10, decimal) to get the amount used in the transaction. This value can be NULL, as decimals are hand curated from an outside source and not found on-chain. 

{% enddocs %}

{% docs delegator_address %}

The wallet address of the individual who owns the delegated asset.

{% enddocs %}

{% docs depositor %}

The wallet address of the individual who deposited funds into the proposal. At least 500 OSMO must be deposited into a proposal after it is submitted for it to go to vote. 

{% enddocs %}

{% docs fee %}

The fee is paid by the initiator of the transaction. Fee = gas * gas price and is given in micro-OSMO. 

{% enddocs %}

{% docs foreign_address %}

The foreign address of the transfer if exists. This can be an IBC address or other non-IBC address

{% enddocs %}

{% docs foreign_chain %}

The name of the foreign chain transfer if exists

{% enddocs %}

{% docs from_amount %}

The amount that the user sent to be swapped for another currency. 

{% enddocs %}

{% docs from_currency %}

The currency that the user sent to be swapped for another currency. 

{% enddocs %}

{% docs from_decimal %}

Divide the swap_from_amount by POW(10, swap_from_decimal) to get the amount the user swapped. 

{% enddocs %}

{% docs gas_used %}

The amount of gas consumed by the transaction. 

{% enddocs %}

{% docs gas_wanted %}

Amount of gas requested for a transaction. It is provided by users when the transaction is generated.

{% enddocs %}

{% docs ingested_at %}

The time the block was sent to the Flipside database. 

{% enddocs %}

{% docs inserted_timestamp %}

The time the block was inserted into to the Flipside database. 

{% enddocs %}

{% docs is_superfluid %}

The length of time the LP toke takes to unlock

{% enddocs %}

{% docs label %}

The label or name of the address. 

{% enddocs %}

{% docs label_subtype %}

Adds more detail to the label type. 

{% enddocs %}

{% docs label_type %}

A broad category that describes what a label is representing. 

{% enddocs %}

{% docs liquidity_provider_address %}

The address of user that provided or removed liquidity from the pool.

{% enddocs %}

{% docs lock_duration %}

The length of time the LP toke takes to unlock

{% enddocs %}

{% docs lock_id %}

The unique id related to the specifc address, pool, and lock duration

{% enddocs %}

{% docs locker_address %}

The address of user that performed an action related to locked lp tokens

{% enddocs %}

{% docs memo %}

The memo the user input into the transaction body

{% enddocs %}

{% docs msg_action %}

The attribute value when the message type = 'mesage' and the attribute key = 'action'

{% enddocs %}

{% docs msg_action_description %}

A user friendly description of what action occured

{% enddocs %}

{% docs msg_group %}

Value grouping different messages together to represent a single action. Format will include the numeric msg_group and msg_sub_group with a ":" seperator. The subgroup will always be 0 except for "Exec" actions. NULL group means messages are related to the header (overall transaction)

{% enddocs %}

{% docs msg_index %}

Short for "message index," the position in which messages occur in a transaction. 

{% enddocs %}

{% docs msg_sub_group %}

Silver only -- Numeric value grouping different messages together to represent a single action within a group. This is relevent for exec actions that contain mutiple underlying actions. NULL sub group means messages are related to the header (overall transaction)

{% enddocs %}

{% docs msg_type %}

A string containing information about the type of message occurring.

{% enddocs %}

{% docs pool_assets %}

List of 2 or more asset addresses belonging to the pool

{% enddocs %}

{% docs pool_id %}

Identifier for the pool within the module

{% enddocs %}

{% docs pool_module %}

Module used to create liquidity pool

{% enddocs %}

{% docs project_name %}

The name of the project the label belongs to. 

{% enddocs %}

{% docs proposal_description %}

The description or body of the governance proposal. 

{% enddocs %}

{% docs proposal_id %}

Numeric ID that corresponds to the proposal. 

{% enddocs %}

{% docs proposal_title %}

The title of the governance proposal that was submitted on-chain. 

{% enddocs %}

{% docs proposal_type %}

The type of proposal that was submitted. 

{% enddocs %}

{% docs proposer %}

The address of the validator that submitted the proposal.

{% enddocs %}

{% docs proposer_address %}

The address of the validator that proposed the block.

{% enddocs %}

{% docs raw_metadata %}

Additional details about the validator or token in json format. 

{% enddocs %}

{% docs receiver %}

The wallet address of the individual received tokens in the transfer.

{% enddocs %}

{% docs redelegate_source_validator_address %}

The wallet address of the source alidator in a redelegation staking action.

{% enddocs %}

{% docs sender %}

The wallet address of the individual sent tokens in the transfer.

{% enddocs %}

{% docs silver_msg_group %}

Numeric value grouping different messages together to represent a single action.  NULL group means messages are related to the header (overall transaction)

{% enddocs %}

{% docs to_amount %}

The amount that the user sent to be swapped for another currency. 

{% enddocs %}

{% docs to_currency %}

The currency that the user sent to be swapped for another currency. 

{% enddocs %}

{% docs to_decimal %}

Divide the swap_to_amount by POW(10, swap_to_decimal) to get the amount the user received. 

{% enddocs %}

{% docs trader %}

The wallet address of the individual who initiated the swap.

{% enddocs %}

{% docs transfer_type %}

Details on the type of transfer occurring during the transaction. "IBC_Transfer_In" = depositing tokens onto Osmosis. "IBC_transfer_out" = withdrawing tokens from Osmosis. "Osmosis" = wallet to wallet transfer on Osmosis.  

{% enddocs %}

{% docs tx_body %}

The top level transaction body for the transaction

{% enddocs %}

{% docs tx_caller_address %}

The wallet address of the individual who initiated the transaction.

{% enddocs %}

{% docs tx_code %}

A number that corresponds to various error codes. When "0", the transaction is successful. Non-zero numbers signify different types of transaction failures. 

{% enddocs %}

{% docs tx_count %}

The number of transactions that occurred during a block. 

{% enddocs %}

{% docs tx_from %}

The wallet address of the individual who initiated the transaction

{% enddocs %}

{% docs tx_id %}

A unique key that identifies a transaction. Called "TxHash" on block explorers.

{% enddocs %}

{% docs tx_status %}

Transaction status is "SUCCEEDED" if the transaction went through, "FALSE" if the transaction failed. This column is deprecating soon. Please switch over your queries to use the tx_succeeded column instead.

{% enddocs %}

{% docs tx_succeeded %}

Transaction status is "TRUE" if the transaction was successful, "FALSE" if the transaction failed. 

{% enddocs %}

{% docs unlock_time %}

When the LP token is fully unlocked and liquid again

{% enddocs %}

{% docs unpool_new_lock_ids %}

The new lock ids generated when a lp position is unpooled

{% enddocs %}

{% docs validator_address %}

The wallet address of the validator related to the staking action.

{% enddocs %}

{% docs validator_address_reward %}

The wallet address that recieves the commissiion of the validator.

{% enddocs %}

{% docs validator_hash %}

The root hash of the new validator set. 

{% enddocs %}

{% docs vote_option %}

How the delegator voted on the proposal. 

{% enddocs %}

{% docs vote_weight %}

Denotes what portion of a user's stake is put toward the voting option. If "1", 100% of the voter's voting power is put toward the selected option.  

{% enddocs %}

{% docs voter %}

Address of the delegator that voted on the proposal. 

{% enddocs %}
